Movie Info: Nasha is 2013 Indian teen coming-of-age film directed by Amit Saxena. The film marks the Bollywood debut of Shivam Patil and kingfisher model Poonam Pandey. Upon release, Nasha gained mixed critical response, but the young debutante Shivam got very good critical appreciation throughout the industry for his acting performance.


